import React from "react";
import { Link } from "react-router-dom";
import './title.component.scss'

const Title = ({logo,page_title}) =>{
    console.log(logo, page_title);
    return(
        <div className="title">
            <h1 style={{margin:'2rem'}}><Link to="/" style={{textDecoration:'none', color:'white'}}>SPORTS ALMANAC</Link></h1>
            <div>
            {(logo == null)?null:<div><img className="title-logo-image" src={logo} alt="#"/></div>}
            {(page_title == null )?null:<div><h1>{page_title}</h1></div>}
            </div>
        </div>
    )
}

export default Title;
